import React from 'react';
import { useEffect, useState } from 'react'
import axios from 'axios'
import {Swiper,SwiperSlide} from 'swiper/react';
import Logo from './logo1.jpg'
import SwiperCore, { EffectCoverflow } from 'swiper';
import 'swiper/swiper-bundle.css';
SwiperCore.use([EffectCoverflow]);
 
function Testimonial(){
    const[data,setData]=useState([]);
    useEffect(()=>{
        axios.get("http://localhost:8000/testomonial/")
        .then(res=>{
          console.log(res)
          setData(res.data)
        })
        .catch(err=>{
          console.log(err)
        })

    })

return (
    <Swiper 
    effect="coverflow"
    slidesPerView='auto'
    centeredSlides='true'
  >
    <SwiperSlide style={{width:"20rem",height:"22.5rem"}} >
    {data.map(data=>{  <div style={{width:"20rem",height:"22rem",boxShadow:" 1px 1px 5px gray",marginBottom:"1rem"}}>
      
          <img src={data.image} style={{width:"10rem",height:"10rem",left:"27%",top:"6%",position:"absolute",borderRadius:"50%"}}/>
          
  
        
        <div style={{position:"absolute",height:"7rem",width:"12rem",top:"50%",left:"25%",fontWeight:"600"}}>
            <p> Hello its me ceo of this comapany and my name is jackson rai Hello its me ceo of this comapany and my name is jackson rai</p>
        </div>
        </div>    })}
        
    </SwiperSlide>
   

  </Swiper>
      
    )
       
   
}

export default Testimonial;
